import { book } from '../../types';

interface props {
    books: book[];
}

export const Hyperlink = ({ books }: props) => {
    return (
        <div>
            <a
                href={`/book/${book.id}`}
                className="font-medium text-blue-600 dark:text-blue-500 hover:underline"
            >
                {book.name}
            </a>
        </div>
    );
};
